INSERT INTO `lesson` VALUES (1,'Introduction to Merino',2,100.00,'COMP639',NULL),(2,'Introduction to Merino Wool',7,100.00,'MRN101','This introductory lesson provides an overview of the history, characteristics, and benefits of merino wool. Participants will learn about the unique properties of merino wool fibers and their applications in various industries, including fashion, outdoor apparel, and textiles.'),(3,'Merino Wool Processing Techniques',6,150.00,'MRN102','Explore the intricate processes involved in transforming raw merino wool into high-quality yarns and fabrics. This lesson covers shearing, sorting, scouring, carding, spinning, and weaving techniques used in merino wool processing, along with the importance of quality control measures.'),(4,'Merino Sheep Breeding Fundamentals',7,120.00,'MRN103','Delve into the fundamentals of merino sheep breeding, including genetic selection, mating systems, and reproductive management practices. Participants will gain insights into breeding objectives, performance recording, and the use of modern technologies to enhance merino sheep productivity and wool quality.'),(5,'Advanced Merino Wool Quality Control',7,180.00,'MRN104','This advanced lesson focuses on quality control measures throughout the merino wool production chain. Topics include fiber testing methods, standards compliance, traceability systems, and sustainable practices to ensure consistent quality and meet consumer demands.'),(6,'Merino Wool Dyeing and Finishing',2,90.00,'MRN105','Gain insights into the art and science of dyeing and finishing merino wool textiles. Participants will learn about dye types, colorfastness properties, dyeing techniques, and environmentally friendly finishing processes to create vibrant and durable merino wool products.'),(7,'Sustainable Merino Farming Practices',6,200.00,'MRN106','Explore sustainable farming practices tailored to merino sheep production systems. This lesson covers pasture management, water conservation, biodiversity preservation, animal welfare standards, and eco-friendly solutions to minimize environmental impact and maximize farm profitability.'),(8,'Merino Wool Marketing Strategies',2,70.00,'MRN107','Discover effective marketing strategies to promote merino wool products in domestic and international markets. Topics include brand positioning, target audience analysis, digital marketing tactics, storytelling techniques, and collaboration opportunities within the merino wool industry.'),(9,'Merino Wool Fabric Innovation',6,110.00,'MRN108','Stay abreast of the latest innovations in merino wool fabric development and applications. From performance textiles for outdoor adventures to luxurious fabrics for high-end fashion, this lesson showcases cutting-edge technologies, design trends, and consumer preferences driving fabric innovation.'),(10,'Merino Wool Fashion Trends',7,130.00,'MRN109','Explore current and emerging fashion trends featuring merino wool as a versatile and sustainable textile choice. Participants will gain insights into runway looks, celebrity endorsements, consumer preferences, and market forecasts shaping the future of merino wool fashion.'),(11,'Merino Wool in Outdoor Apparel',5,160.00,'MRN110','Discover the performance benefits of merino wool in outdoor apparel design and construction. From moisture-wicking baselayers to insulating midlayers and durable outerwear, this lesson highlights the natural properties of merino wool that make it an ideal choice for adventurers and athletes.');
/*!40000 ALTER TABLE `lesson` ENABLE KEYS */;
