INSERT INTO `workshop` VALUES (1,'Merino at Lincoln',1,100.00,'<p>An immersive workshop that invites participants into the world of one of New Zealand\'s most iconic agricultural industries: merino sheep farming. Hosted at Lincoln University, renowned for its expertise in agriculture and farming practices, this workshop offers a unique opportunity to delve into the intricacies of merino sheep husbandry and the broader context of sustainable agriculture.</p>'),(2,'Merino Wool Spinning Workshop',6,50.00,'Learn the art of spinning merino wool fibers into yarns of various thicknesses and textures. This hands-on workshop covers basic spinning techniques, fiber preparation, wheel maintenance, and creative yarn design. Suitable for beginners and intermediate spinners.'),(3,'Merino Wool Dyeing Masterclass',1,120.00,'Unlock the secrets of dyeing merino wool to create stunning and unique colorways. Explore different dyeing methods such as hand painting, immersion dyeing, and resist techniques. Participants will experiment with color mixing, color theory, and safe dye handling practices.'),(4,'Needle Felting with Merino Wool',4,80.00,'Discover the therapeutic art of needle felting using soft and luxurious merino wool roving. In this workshop, participants will learn needle felting basics, including shaping, sculpting, and detailing techniques. Create adorable felted creatures, ornaments, and embellishments.'),(5,'Merino Wool Knitting Retreat',2,180.00,'Immerse yourself in a weekend of knitting bliss with merino wool as your muse. This retreat offers a relaxed and supportive environment for knitters of all skill levels. Enjoy workshops on advanced knitting techniques, pattern customization, and garment finishing. Indulge in yarn shopping, delicious meals, and cozy fireside chats.'),(6,'Wet Felting Merino Wool Hats',3,150.00,'Create one-of-a-kind felted hats using the wet felting technique and luxurious merino wool fibers. This workshop covers hat design principles, template making, and felting methods to achieve seamless and well-fitting hats. Participants will leave with a finished felted hat ready to wear or gift.');
